import React, { useState, useEffect } from "react";
import axios from "axios";
import { Link } from "react-router-dom";
import AutoCarousel from "../Components/AutoCarousel";
import "react-responsive-carousel/lib/styles/carousel.min.css";
import "./MainPage.css";
import Slick from "../Components/Slick";
import SlickCard from "../Components/SlickCard";
import CatalogProductItem from "../Components/CatalogProductItem";
import { baseUrl } from "../baseUrl/baseUrl";
import SearchProductItem from "../Components/SearchProductItem";

const MainPage = () => {
  const data = [
    {
      _id: "61d6a497451a9e866f38ad6e",
      title: "Akbar",
      todo: "I am a full stack node js sdasdasd asdasdasdveloper",
    },

    {
      _id: "61d6a497451a9e866f38ad6e",
      title: "Muxlis",
      todo: "I am banker asdasd as das d",
    },

    {
      _id: "61d6a497451a9e866f38ad6e",
      title: "Baxrom",
      todo: "I know english well asda asd asd a",
    },

    {
      _id: "61d6a497451a9e866f38ad6e",
      title: "Iftixor",
      todo: "I know russian well asdasd a sd asd",
    },

    {
      _id: "61d6a497451a9e866f38ad6e",
      title: "Umida",
      todo: "I know economic  asd asd as d",
    },

    {
      _id: "61d6a497451a9e866f38ad6e",
      title: "Koka",
      todo: "I am a traider adasd  asdasd",
    },

    {
      _id: "61d6a497451a9e866f38ad6e",
      title: "Sardor",
      todo: "I am accounter adsasd r",
    },

    {
      _id: "61d6a497451a9e866f38ad6e",
      title: "Sardor",
      todo: "I am accounter asdasd  asd",
    },

    {
      _id: "61d6a497451a9e866f38ad6e",
      title: "Sardor",
      todo: "I am accounter asdasdsdas",
    },
  ];

  const [searchWord, setSearchWord] = useState("");
  const [searchedProducts, setSearchedProducts] = useState([]);
  const [error, setError] = useState("");

  const onChange = (e) => {
    setSearchWord(e.target.value);
  };

  const searchHandler = (e) => {
    if (!searchWord.trim()) {
      var elems = document.querySelectorAll(".modal");
      window.M.Modal.init(elems);

      axios
        .post(baseUrl + `/products/search?q=${searchWord}`)
        .then((res) => setSearchedProducts(res.data))
        .catch((e) => {
          setError("Товары по запросу не найдены");
        });
    } else {
      window.M.toast({ html: "Сначала заполните полью!" });
    }
  };

  return (
    <div className="container">
      <div id="modal1" className="modal modal-fixed-footer">
        <div className="modal-content" style={{ position: "relative" }}>
          <h4 style={{ position: "sticky", top: 0, background: "transparent" }}>
            Товары по запросу "{searchWord}"
          </h4>
          {searchedProducts.length > 0 ? (
            searchedProducts.map((item) => <SearchProductItem />)
          ) : (
            <h3>{error}</h3>
          )}
        </div>
        <div className="modal-footer">
          <span className="modal-close waves-effect waves-green btn-flat">
            Close
          </span>
        </div>
      </div>

      <div className="box-image mb-3">
        <Link to="/catalog">
          <div className="box-image__catalog mr-2 valign-wrapper">
            <i className="fas fa-list" style={{ marginRight: "5px" }}></i>
            <span>Каталог</span>
          </div>
        </Link>
        <div className="box-image__search valign-wrapper">
          <div className="input-field search">
            <div className="search__input">
              <input
                type="text"
                id="autocomplete-input"
                className="autocomplete"
                onChange={(e) => onChange(e)}
              />
            </div>
            <button
              data-target="modal1"
              className="search__button modal-trigger"
              href="#modal2"
              onClick={(e) => searchHandler(e)}
            >
              <i className="fas fa-search"></i>
            </button>
          </div>
        </div>
      </div>

      <Slick data={data} Card={SlickCard} numSlide={5} />
      <AutoCarousel />
      <Slick data={data} Card={CatalogProductItem} numSlide={4} />
      <AutoCarousel />
      <Slick data={data} Card={CatalogProductItem} numSlide={4} />
    </div>
  );
};

export default MainPage;
